import React from 'react'

const AddUserForm = props => {
    return (
            <form>
                <label>Name</label>
                <input
                    type='text'
                    name='name'
                    value={props.user.name}
                    // onChange={handleInputChange}
                />
                <label>Username</label>
                <input
                    type='text'
                    name='username'
                    value={props.user.surname}
                    // onChange={handleInputChange}
                />
                <button>Add new user</button>
            </form>
        )
}

export {AddUserForm}
